import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Gait Diagnosis System UMCG</h1>
      </header>
      <div className="data-box">
        <button>Upload Data</button>
      </div>
    </div>

  );
}

export default App;
